INSERT INTO `story` VALUES (2,'Disney Fairies Short: Bee\'s Eye','https://www.youtube.com/embed/i5q3CzTciSw?ecver=1','<p>Tink hits the bull\'s-eye with her own version of darts -- but what does Fairy Mary think?</p>','2017-05-30 11:17:06','2017-10-10 16:19:47','59dcc8f38d8b7_maxresdefault.jpg',NULL,NULL,NULL,NULL),(3,'The Hive','https://www.youtube.com/embed/226QBLjWKiI?ecver=1','<p>Buzzbee wants to go out to play but has to tidy his room first. He gets distracted with all the fun things he can do in his room and starts playing ball. Mum reminds him that he\'s supposed to be tidying, and then they can have some fun!</p>','2017-05-30 11:17:06','2017-09-25 15:49:43','59c8ea73ad904.jpg',NULL,NULL,NULL,NULL),(4,'Noi, albinele - Calin Gruia','https://www.youtube.com/embed/ftYVl4um41w?ecver=1','<p>Trantorul a plecat sa se plimbe prin gradina şi s-a &icirc;ntors seara tarziu. Nu era obosit cand a intrat &icirc;n stup. De ce sa fie? De somn? A dormit pe o floare de nalba&hellip; A visat ceva, tolanit pe un trandafir roşu&hellip; S-a certat cu un fluture&hellip; A vorbit ceva cu o viespe. Şi ziua a trecut. Atata paguba! Maine o sa fie alta zi, gandi trantorul şi se-ndrepta repede spre sala de mese a stupului. Nu gasi pe nimeni acolo. Şi nu-şi vazu nici ceaşca pe nicaieri. Suparat, &icirc;ncepu sa strige:</p>\r\n<p>&ndash; Ei, dar unde-i ceşcuţa mea? Unde-i cornuleţul meu?&hellip; Nemaipomenit&hellip;</p>\r\n<p>O albina mai &icirc;n varsta, cu o matura sub aripa, se apropie de el şi-i spune:</p>\r\n<p>&ndash; Nu te enerva&hellip; Mananci ce ai adus.</p>\r\n<p>&ndash; Nu &icirc;nţeleg ce vrei sa spui&hellip;</p>\r\n<p>&ndash; Nu ţi se mai da mancare de azi &icirc;nainte, &icirc;i spuse batrana albina.</p>\r\n<p>&ndash; Dar mor de foame. Nu se poate&hellip; Am tot dreptul la porţia mea!.</p>\r\n<p>&ndash; Poftim matura, fa curaţenie pe sub cei doi faguri&hellip;</p>\r\n<p>&ndash; Eu? Eu cu matura?&hellip; Dar n-am muncit niciodata.</p>\r\n<p>&ndash; Ei, vezi?&hellip; Asta-i pricina&hellip; Noi muncim şi noi mancam&hellip; mierea nu pica din cer&hellip; Nu te trimite nimeni sa alergi prin flori&hellip; Dar de curaţat, de reparat, de aerisit, de adus apa la pui, de luptat cu duşmanii noştri din afara, ma rog, se gaseste de lucru&hellip;</p>\r\n<p>&ndash; Şi cine a hotarat toate astea?&hellip;</p>\r\n<p>&ndash; Noi, albinele&hellip;</p>\r\n<p>&ndash; Am sa ma plang &icirc;mpotriva voastra&hellip;</p>\r\n<p>&ndash; N-ai decat&hellip;</p>\r\n<p>&ndash; Am sa ma plang stapanului prisacii&hellip; 0 sa vedeţi voi. O sa va para rau!</p>\r\n<p>Şi trantorul, suparat, ieşi pe urdiniş&hellip; Pe unde o fi umblat, n-a putut sa afle nimeni. Daca-l intalniţi cumva, explicaţi-i voi cum stau lucrurile cu cei care nu vor sa munceasca.</p>','2017-05-30 11:17:06','2017-10-31 12:56:46','59de19c495b0a_aum-albinuta.jpg','English','3+','Short film','Animation Comedy'),(5,'Story','https://www.youtube.com/embed/i5q3CzTciSw?ecver=1','<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>','2017-05-30 11:49:47','2017-10-16 16:29:09','59e4b4251676d_Aulii-Cravalho-as-Moana-Waialiki-03.jpg',NULL,NULL,NULL,NULL),(6,'Story added via Sonata Admin','https://www.youtube.com/embed/i5q3CzTciSw?ecver=1','<p>Tink hits the bull\'s-eye with her own version of darts -- but what does Fairy Mary think?</p>','2017-10-10 14:27:54','2017-10-10 14:27:54','59dcaeba6e236_maxresdefault.jpg',NULL,NULL,NULL,NULL);
